import styled from "@emotion/styled";
import { Button, Grid, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const contents = ["c","d","e"];

const NotionFreeButton = styled(Button)({
    backgroundColor: 'tomato',
    color: 'white',
    borderRadius:'5px',
    '&:hover': {
        backgroundColor: 'gray',
    },
    height:'30px'
})

const FirstTypo = styled(Typography)({
    fontWeight : 'bold',
    marginY: "5px",
})

function Home(){

    return(
      <Grid container>
        <Grid item md={6} xs={10}>
            <Typography variant="h3">모든 팀을 위한</Typography>
            <Typography variant="h3">하나의 워크스페이스</Typography>
            <Typography variant="body2">Notion은 단순한 워드프로세서가 아닙니다. </Typography>
            <Typography variant="body2">내 스타일에 맞게 커스텀해서 사용하세요.</Typography>
            <NotionFreeButton> Notion 무료 체험 </NotionFreeButton>
        </Grid>
        <Grid item md={6} xs={10}>
            b
        </Grid>
        {contents.map( (content , index) =>
        <Grid item xs={10} key={index}> {content} </Grid>
        )}
      </Grid>
    );

}

export default Home;
